import Link from 'next/link';
import style from '../styles/Footer.module.scss';


const Footer = props => {
  return (
    <footer className={style.ax_footer}>
      <div className={style.ax_container}>
        <div>
          <img src={props.logo} alt={props.brokerage} />
        </div>

        <div>
          <div className={style.ax_footer_contact}>
            <h3>Email</h3>
            <p>{props.email}</p>
          </div>

          <div className={style.ax_footer_contact}>
            <h3>Phone</h3>
            <p>{props.phone}</p>
          </div>

          <div className={style.ax_footer_contact}>
            <h3>Address</h3>
            <p>{props.address}</p>
          </div>
        </div>

        <div>
          {props.facebook ? <Link href={props.facebook}>facebook</Link> : ''}
          {props.instagram ? <Link href={props.instagram}>instagram</Link> : ''}
          {props.linkedin ? <Link href={props.linkedin}>linkedin</Link> : ''}
          {props.twitter ? <Link href={props.twitter}>twitter</Link> : ''}
          {props.youtube ? <Link href={props.youtube}>youtube</Link> : ''}
        </div>
      </div>
    </footer>
  )
}

export default Footer;
